import { css } from "@emotion/react";
import styled from "@emotion/styled";
import { EarnPool } from "./EarnPool";
import { COLLATERAL_TOKENS } from "src/config";

export const EarnView: React.FC = () => {
  return (
        <Table>
          <thead>
            <tr>
              <th
                css={css`
                  text-align: left !important;
                `}
              >
                Asset
              </th>
              <th>APY</th>
              <th>Total Supply</th>
              <th>Total Borrow</th>
              <th>Utilization</th>
              <th />
            </tr>
          </thead>
          <tbody>
            {COLLATERAL_TOKENS.map((token) => (
              <EarnPool key={token.address} token={token}/>
            ))}
          </tbody>
        </Table>
  );
};

const Table = styled.table`
  th {
    color: #546e7a;
    font-weight: 600;
    font-size: 14px;
  }
  td {
    color: #fff;
    font-size: 16px;
    line-height: 20px;
  }
  th,
  td {
    text-align: center;
  }
  width: 100%;
`;
